INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (119901, 119901, 1, 0, 1, 14, 0, "2024/12/31 11:59:59", "ミヤコ（クリスマス）", 0, 3, "みやこ", 0, 119901, 2.17, "2024/12/22 12:00:00", 302, 450, 0, 1, 119901, 0, "【物理】中衛で、味方をプリンで強化する幽霊聖少女。\n物理攻撃力と物理クリティカルアップのプリンパワーの\nフィールドで自分のスキルも強化し、猛攻を繰り出す。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (120001, 120001, 5, 0, 1, 6, 0, "2025/03/15 14:59:59", "シズル（ノワール）", 0, 3, "しずる", 0, 120001, 2.375, "2025/03/10 12:00:00", 190, 450, 0, 5, 120001, 0, "【物理】前衛で猛攻から味方を守護する闇のお姉ちゃん。\nバトル開始時の行動不能無効スキルで周囲の味方を守り、\n範囲を束縛するスキルで敵を牽制し、戦況を一変する。", 0, 1);
