INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (120701, 120701, 22, 0, 1, 1, 0, "2025/01/20 11:59:59", "シェフィ（ニューイヤー）", 0, 3, "しぇふぃ", 0, 120701, 1.84, "2025/01/15 15:00:00", 283, 450, 0, 4, 120701, 0, "【物理】前衛で、雪花舞う晴れ空をゆく新春氷竜少女。\nＵＢで顕現させる氷竜の牙で味方への強化スキルを高め\n自身の範囲攻撃技と共に苛烈な攻勢で敵陣を凍滅する。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (120801, 120801, 22, 0, 1, 2, 0, "2030/12/31 15:00:00", "ルカ（ニューイヤー）", 0, 1, "るか", 0, 120801, 1.3, "2023/10/16 15:00:00", 193, 450, 0, 4, 120801, 0, "【物理】前衛で雪月花の舞を納める新春の姉御。\n攻撃を当てる度に増加する【剣の刻印】でＵＢとスキルの\n威力を上昇させ、目にも止まらぬ斬撃で敵を圧倒する。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (120901, 120901, 38, 0, 2, 12, 0, "2025/01/20 11:59:59", "イリヤ（ニューイヤー）", 0, 3, "いりや", 0, 120901, 1.425, "2025/01/15 15:00:00", 424, 450, 0, 3, 120901, 0, "【魔法】中衛で自らの血を代償に力を振るう新春吸血鬼。\n自身のＨＰを消費して放つ強力なスキルと、敵からＴＰを\n吸収するスキルを自在に操り、目の前の敵を撃滅する。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (121001, 121001, 41, 0, 1, 1, 0, "2025/02/24 11:59:59", "ペコリーヌ（オーバーロード）", 0, 3, "ぺこりーぬ", 0, 121001, 2.25, "2025/02/20 12:00:00", 164, 450, 0, 5, 121001, 0, "【物理】前衛で、仲間との絆を力に変え戦う腹ペコ王女。\n敵のＨＰ状態で永続の物理攻撃力上昇と、短時間の特大\n攻撃力上昇＆自己ＴＰ回復を使い分け戦況を一変させる。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (121101, 121101, 42, 0, 2, 1, 0, "2025/02/24 11:59:59", "キャル（オーバーロード）", 0, 3, "きゃる", 0, 121101, 2.07, "2025/02/20 12:00:00", 588, 450, 0, 7, 121101, 0, "【魔法】中衛で仲間との絆を力に変え戦うツンデレ猫娘。\n敵を妨害するスキルと、ＵＢで敵全体を恐慌状態にし既に\n恐慌状態の敵のＴＰをダウンさせ、全戦場を掌握する。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (121201, 121201, 40, 0, 1, 6, 0, "2030/12/31 15:00:00", "ラビリスタ（オーバーロード）", 0, 1, "らびりすた", 0, 121201, 1.55, "2023/11/16 15:00:00", 260, 450, 0, 4, 121201, 0, "【物理】前衛で世界の理をすべて見つめる『迷宮女王』。\n味方を攻撃面で強化し、継続ＨＰ回復を全体に付与する\nスキルで戦線を整え、自身も圧倒的な力で敵を殲滅する。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (121301, 121301, 3, 0, 1, 3, 0, "2030/12/31 15:00:00", "クルミ（ステージ）", 0, 3, "くるみ", 0, 121301, 1.9, "2022/03/03 19:00:00", 731, 450, 0, 3, 121301, 0, "【物理】後衛で、皆のため意を決し奮起する小さな女優。\n残りＨＰが多いほど物理攻撃力がアップし、物理攻撃無効\nバリアのスキルやＨＰ・ＴＰ継続回復で味方を支援する。", 0, 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (121401, 121401, 7, 0, 2, 15, 0, "2030/12/31 15:00:00", "ミサキ（ステージ）", 0, 3, "みさき", 0, 121401, 2.27, "2022/03/15 15:00:00", 742, 450, 0, 7, 121401, 0, "【魔法】後衛で後ろの味方を強化する魔法少女の看板娘。\n後衛の味方をバリアとＴＰ継続回復で支援し、自分の魔法\n攻撃力に応じ強化される攻撃力アップスキルで鼓舞する。", 0, 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (121501, 121501, 6, 0, 1, 12, 0, "2025/04/30 11:59:59", "アユミ（怪盗）", 0, 3, "あゆみ", 0, 121501, 2.0, "2025/04/26 12:00:00", 590, 450, 0, 6, 121501, 0, "【物理】中衛で、闇夜に身を潜める神出鬼没の怪盗少女。\n敵の目の前から姿を消す隠密スキルや、遠くの敵に対する\nＴＰダウンスキルを駆使して、敵陣後方から瓦解させる。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (121601, 121601, 3, 0, 1, 17, 0, "2030/12/31 15:00:00", "イノリ（怪盗）", 0, 3, "いのり", 0, 121601, 1.425, "2022/04/15 15:00:00", 292, 450, 0, 3, 121601, 0, "【物理】前衛で闇に紛れ会心の一撃を放つ怪盗ドラゴン。\n隠密効果中、ダメージが大アップし必ずクリティカルする\nＵＢとスキルを駆使し安定したダメージを敵に叩き込む。", 0, 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 121701, 0, 0, 0, 0, 0, "2030/12/31 15:00:00", "アキノ（アキノ＆サレン）", 0, 3, "あきの", 180901, 0, 0.0, "2015/04/01 15:00:00", 421, 0, 0, 0, 121701, 0, "", 1, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 121801, 0, 0, 0, 0, 0, "2030/12/31 15:00:00", "サレン（アキノ＆サレン）", 0, 3, "されん", 180901, 0, 0.0, "2015/04/01 15:00:00", 421, 0, 0, 0, 121801, 0, "", 1, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (121901, 121901, 5, 0, 2, 12, 0, "2030/12/31 15:00:00", "アンナ（パイレーツ）", 0, 3, "あんな", 0, 121901, 2.125, "2022/05/15 15:00:00", 293, 450, 0, 5, 121901, 0, "【魔法】前衛で己を鼓舞し高めた魔力を放つ蒼海の冥姫。\n発動の度、攻撃力とクリティカル時ダメージが上昇する\nＵＢと自己犠牲を払う強力な範囲攻撃技で敵を撃滅する。", 0, 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (122001, 122001, 3, 0, 1, 14, 0, "2030/12/31 15:00:00", "シノブ（パイレーツ）", 0, 3, "しのぶ", 0, 122001, 1.425, "2022/05/03 19:00:00", 380, 450, 0, 3, 122001, 0, "【物理】中衛で、彷徨える魂を解き放つ海星の霊能少女。\n攻撃の際、付与する【霊錨の刻印】を駆使し、ダメージ量\nアップのスキルと防御力ダウンのＵＢで敵を浄滅へ導く。", 0, 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (122101, 122101, 35, 0, 1, 9, 0, "2030/12/31 15:00:00", "アオイ（キャンプ）", 0, 1, "あおい", 0, 122101, 1.97, "2024/04/18 15:00:00", 731, 450, 0, 35, 122101, 0, "【物理】後衛で百千の矢を放つ、ぼっちの山籠りエルフ。\n物理魔法無効バリアで耐え凌ぎ、敵全体への射撃と自分の\n間合いに入った敵への強力な弓雨の追撃で掃討する。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (122201, 122201, 4, 0, 1, 8, 0, "2030/12/31 15:00:00", "ユカリ（キャンプ）", 0, 3, "ゆかり", 0, 122201, 1.84, "2022/05/31 12:00:00", 419, 450, 0, 4, 122201, 0, "【物理】中衛で最高の一杯を自然と共に愉しむ元聖騎士。\n【至福のひと時】が増えるほどに、味方の物理攻撃力や\nクリティカル時のダメージを強力に強化し、勝利を掴む。", 0, 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (122301, 122301, 43, 0, 2, 0, 0, "2030/12/31 15:00:00", "ヴァンピィ", 0, 3, "うぁんぴぃ", 0, 122301, 1.425, "2022/06/15 15:00:00", 564, 450, 0, 43, 122301, 0, "【魔法】中衛で、幼き竜と共に歩むさいきょーの吸血姫。\n味方全体の強化と、敵のＴＰを吸収するスキルで力を蓄え\nＵＢ発動後ベスと共闘し防御ダウンと強撃で攻勢に出る。", 0, 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (122401, 122401, 1, 0, 1, 8, 0, "2030/12/31 15:00:00", "ヒヨリ（サマー）", 0, 1, "ひより", 0, 122401, 2.42, "2024/06/17 15:00:00", 264, 450, 0, 1, 122401, 0, "【物理】前衛で皆にエールを送り鼓舞する真夏の元気娘。\n味方のＨＰを継続回復し行動速度アップの他、味方の数に\n応じてクリティカル強化と攻撃力を引き上げ勝利に導く。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (122501, 122501, 4, 0, 1, 0, 0, "2025/08/31 11:59:59", "レイ（サマー）", 0, 3, "れい", 0, 122501, 1.965, "2025/08/22 12:00:00", 250, 450, 0, 4, 122501, 0, "【物理】前衛で水刃の加護を纏い水面を駆ける渚の剣士。\nクリティカル時のダメージを底上げしＵＢ発動の度、纏う\n【水刃の加護】で全スキルダメージを上げ、敵陣を穿つ。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (122601, 122601, 7, 0, 2, 0, 0, "2030/12/31 15:00:00", "ユイ（サマー）", 0, 3, "ゆい", 0, 122601, 2.27, "2022/07/15 15:00:00", 554, 450, 0, 7, 122601, 0, "【魔法】中衛で、魔法キャラを補助する夜凪の魔法士。\n累積する攻撃強化スキルとＴＰ回復、物魔両面の無効\nバリアや継続ＨＰ回復で攻守共に味方を支え勝利へ導く。", 0, 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (122701, 122701, 7, 0, 2, 0, 0, "2030/12/31 15:00:00", "キョウカ（サマー）", 0, 3, "きょうか", 0, 122701, 1.92, "2022/08/15 15:00:00", 812, 450, 0, 7, 122701, 0, "【魔法】後衛で、難しい魔法の練習に励む海辺の優等生。\nランダムな敵に当たるスキルの威力は攻撃の際に付与する\n【バタフライシール】で増幅し、防御力もダウンさせる。", 0, 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (122801, 122801, 1, 0, 1, 0, 0, "2030/12/31 15:00:00", "ミソギ（サマー）", 0, 1, "みそぎ", 0, 122801, 2.295, "2024/07/16 15:00:00", 237, 450, 0, 1, 122801, 0, "【物理】前衛で敵後方に花火を仕掛ける夜涼みの悪戯娘。\n敵の最前衛をスタンで足止めしつつ、最後衛を中心とした\nＵＢで狭範囲の敵を引き寄せ、ＴＰダウンで攻勢を阻む。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (122901, 122901, 5, 0, 1, 0, 0, "2025/08/31 11:59:59", "ミミ（サマー）", 0, 3, "みみ", 0, 122901, 2.25, "2025/08/22 12:00:00", 361, 450, 0, 5, 122901, 0, "【物理】中衛で巨大バルーンと跳ね回る夏色うさぎっこ。\nＵＢやスキルで全てのマルチターゲットに追加ダメージを\n与え、自己強化と防御力ダウンで強敵のブレイクを狙う。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (123001, 123001, 44, 0, 2, 0, 0, "2025/06/30 11:59:59", "アメス", 0, 3, "あめす", 0, 123001, 2.27, "2025/06/27 12:00:00", 746, 450, 0, 44, 123001, 0, "【魔法】後衛で、新たな姿で騎士の冒険を支える妖精。\nダメージカットや防御力アップ、無効バリアで味方を護り\nバリアを起点とする攻撃力とＴＰの支援で攻勢に転ずる。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (123101, 123101, 7, 0, 2, 0, 0, "2030/12/31 15:00:00", "マホ（エクスプローラー）", 0, 3, "まほ", 0, 123101, 1.795, "2022/09/03 19:00:00", 793, 450, 0, 7, 123101, 0, "【魔法】後衛でぬいぐるみ達と大冒険に挑むマホ隊員。\n味方に付与する【ふわふわウール】は被ダメージ時に消費\nされＴＰを回復し、一気呵成の反撃で活路を切り拓く。", 0, 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (123201, 123201, 3, 0, 1, 0, 0, "2030/12/31 15:00:00", "アヤネ（エクスプローラー）", 0, 3, "あやね", 0, 123201, 1.425, "2022/09/15 15:00:00", 256, 450, 0, 3, 123201, 0, "【物理】前衛で、相棒と困難を越え猛進するアヤネ隊員。\n群る敵を二つの範囲攻撃で一気に捉え、周囲の味方の物理\n攻撃力とクリティカルアップで冒険を阻む壁を打ち崩す。", 0, 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (123301, 123301, 0, 0, 1, 0, 0, "2025/09/30 11:59:59", "ネア", 0, 3, "ねあ", 0, 123301, 1.62, "2025/09/16 15:00:00", 350, 450, 0, 1, 123301, 0, "【物理】中衛で粘液を振りまくキイロいスライムギャル。\nスキルで敵全体の物理攻撃能力やＴＰ上昇を低下させ、\nＵＢでスライム化し全敵を攻撃しつつ無敵ボディを得る。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 123401, 5, 0, 0, 0, 0, "2030/12/31 15:00:00", "ジュン（キャンプ）", 0, 3, "じゅん", 0, 0, 0.0, "2015/04/01 15:00:00", 0, 0, 0, 5, 123401, 0, "", 0, 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (123501, 123501, 6, 0, 1, 0, 0, "2030/12/31 15:00:00", "リン（ハロウィン）", 0, 1, "りん", 0, 123501, 2.34, "2024/09/17 15:00:00", 583, 450, 0, 6, 123501, 0, "【物理】中衛で敵を悪戯で翻弄する恐怖のキョンシー娘。\n最も魔法攻撃力が高い敵に急襲を仕掛け、ＴＰ減少や魔法\n攻撃力ダウン、スタン等の妨害スキルで機先を制する。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (123601, 123601, 4, 0, 1, 0, 0, "2024/10/28 11:59:59", "トモ（ハロウィン）", 0, 3, "とも", 0, 123601, 1.965, "2024/10/24 12:00:00", 262, 450, 0, 4, 123601, 0, "【物理】前衛で、同志と力を合わせ共に戦う夜廻り剣士。\n自分と物理攻撃力が最も高い味方１キャラの攻撃力を大幅\nに上昇させ、目にもとまらぬ剣技で不届き者を成敗する。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (123701, 123701, 21, 0, 2, 0, 0, "2030/12/31 15:00:00", "ナナカ（ハロウィン）", 0, 3, "ななか", 0, 123701, 2.07, "2022/10/15 15:00:00", 741, 450, 0, 7, 123701, 0, "【魔法】後衛で、オタ活に精を出すハロウィン魔法少女。\nＨＰ回復量ダウンで敵の戦略を崩し、ダメージフィールド\nと対象の数で火傷の威力を増す熱狂の炎が敵を包み込む。", 0, 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (123801, 123801, 1, 0, 1, 0, 0, "2024/11/30 11:59:59", "クリスティーナ（ワイルド）", 0, 3, "くりすてぃーな", 0, 123801, 2.295, "2024/11/26 12:00:00", 238, 450, 0, 1, 123801, 0, "【物理】前衛で、戦場を跳ね回るラビット姿の誓約女君。\n物理攻撃を全て回避するスキルと攻撃力の強化で敵陣に\n単身特攻をかけ、ＵＢの範囲攻撃で敵を内から薙ぎ倒す。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (123901, 123901, 2, 0, 1, 0, 0, "2030/12/31 15:00:00", "マツリ（ワイルド）", 0, 3, "まつり", 0, 123901, 2.125, "2022/11/15 15:00:00", 183, 450, 0, 2, 123901, 0, "【物理】前衛で母製の鎧を纏い気合い上々の獣人族騎士。\n自分のＨＰが低いほど与えるダメージと無効バリアの耐久\n力を高め、防御力ダウンと永続攻撃アップで活路を拓く。", 0, 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (124001, 124001, 7, 0, 2, 0, 0, "2024/12/31 11:59:59", "アカリ（クリスマス）", 0, 3, "あかり", 0, 124001, 2.07, "2024/12/22 12:00:00", 438, 450, 0, 7, 124001, 0, "【魔法】中衛で、聖夜の街に幸せを運ぶ双子の妹サンタ。\n自分の魔法攻撃力に応じて効果が上がる味方全体への攻撃\n力強化に加え、単体特大魔法攻撃で勝利の旋律を奏でる。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (124101, 124101, 6, 0, 2, 0, 0, "2030/12/31 15:00:00", "ヨリ（クリスマス）", 0, 1, "より", 0, 124101, 1.965, "2024/11/16 15:00:00", 433, 450, 0, 6, 124101, 0, "【魔法】中衛で、光を灯し幸せを届ける双子の姉サンタ。\n最も近い１キャラの魔法攻撃力や行動速度アップ、ＴＰの\n回復に加え、全員を支援するスキルで聖夜の勝利を飾る。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (124201, 124201, 5, 0, 1, 0, 0, "2030/12/31 15:00:00", "ジュン（クリスマス）", 0, 3, "じゅん", 0, 124201, 2.07, "2022/12/23 12:00:00", 144, 450, 0, 5, 124201, 0, "【物理】前衛で、味方を庇護し祝福する聖白の騎士団長。\nスキルで後方の味方の攻撃能力を強化、ＴＰを回復させ、\n防御力ダウンと自分のＨＰを回復するＵＢで勝機を掴む。", 0, 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 124301, 0, 0, 0, 0, 0, "2030/12/31 15:00:00", "アン（アン＆グレア）", 0, 3, "あん", 181001, 0, 0.0, "2015/04/01 15:00:00", 577, 0, 0, 0, 124301, 0, "", 1, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 124401, 0, 0, 0, 0, 0, "2030/12/31 15:00:00", "グレア（アン＆グレア）", 0, 3, "ぐれあ", 181001, 0, 0.0, "2015/04/01 15:00:00", 577, 0, 0, 0, 124401, 0, "", 1, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (124501, 124501, 21, 0, 2, 0, 0, "2025/01/20 11:59:59", "ホマレ（ニューイヤー）", 0, 3, "ほまれ", 0, 124501, 2.07, "2025/01/15 15:00:00", 707, 450, 0, 7, 124501, 0, "【魔法】後衛で、魔力を笑顔に隠す晴れ着姿の龍の首魁。\n自分の攻撃強化とＴＰ回復をし、ＵＢで放つ曙光の落涙は\n敵数で威力と防御力の減少量を上げ、全ての災厄を祓う。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (124601, 124601, 21, 0, 2, 0, 0, "2025/01/20 11:59:59", "ミサト（ニューイヤー）", 0, 3, "みさと", 0, 124601, 2.44, "2025/01/15 15:00:00", 698, 450, 0, 7, 124601, 0, "【魔法】後衛で真心重ねて味方をもてなす仲居姿の先生。\n全スキルで味方の物理攻撃力とクリティカル能力を上げ、\n魔防やＴＰ上昇の支援とＨＰ、ＴＰの回復で万福を願う。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (124701, 124701, 46, 0, 1, 0, 0, "2030/12/31 15:00:00", "ミツキ（ニューイヤー）", 0, 1, "みつき", 0, 124701, 2.24, "2024/12/16 15:00:00", 590, 450, 0, 7, 124701, 0, "【物理】中衛で、振袖姿で旅館に手を貸す隻眼の闇医者。\n朧ろ状態にした敵への攻撃時、スキルのダメージや防御力\nのダウン値が上昇し、紫煙に捉えた敵を艶然と討ち取る。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (124801, 124801, 0, 0, 1, 0, 0, "2025/02/24 11:59:59", "ノゾミ（リベレイター）", 0, 3, "のぞみ", 0, 124801, 2.14, "2025/02/20 12:00:00", 423, 450, 0, 4, 124801, 0, "【物理】中衛で、未来を信じ希望を灯すトップアイドル。\nバトル開始時に物理キャラのＴＰ特大回復と敵の永続物防\nダウンで加勢し、物理攻撃強化とＴＰ回復で勝利へ導く。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (124901, 124901, 0, 0, 1, 0, 0, "2030/12/31 15:00:00", "カヤ（リベレイター）", 0, 1, "かや", 0, 124901, 1.965, "2025/01/16 15:00:00", 170, 450, 0, 1, 124901, 0, "【物理】前衛で先陣を切り未来を掴む喧嘩屋ドラゴン族。\n初弾が大幅強化するスキルで自分の攻撃力とＴＰを大きく\n高め、威力を増したＵＢで先制し群がる敵を薙ぎ払う。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (125001, 125001, 0, 0, 1, 0, 0, "2025/02/24 11:59:59", "ムイミ（リベレイター）", 0, 3, "むいみ", 0, 125001, 1.965, "2025/02/20 12:00:00", 221, 450, 0, 5, 125001, 0, "【物理】前衛で、相棒と共に明日へと進む大悪党の少女。\n自己強化や物防ダウンを駆使するムイミと、ＵＢ後に一定\n時間共闘するオクトーの追撃で、輝く未来を取り戻す。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (125101, 125101, 47, 0, 1, 0, 0, "2030/12/31 15:00:00", "タマキ（カフェ）", 0, 3, "たまき", 0, 125101, 2.24, "2023/03/03 19:00:00", 825, 450, 0, 8, 125101, 0, "【物理】後衛から客を癒しもてなす猫カフェ店員の猫娘。\n物攻の高いキャラの傍で周囲の物攻アップやＨＰとＴＰを\n回復し、周囲の味方数で強化される攻撃で敵を一掃する。", 0, 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (125201, 125201, 4, 0, 1, 0, 0, "2030/12/31 15:00:00", "モニカ（カフェ）", 0, 3, "もにか", 0, 125201, 1.965, "2023/03/10 12:00:00", 463, 450, 0, 4, 125201, 0, "【物理】中衛で、駄菓子を振舞い福を蒔く猫カフェ店員。\n攻撃を３回受けるまで味方全体の物理攻撃力を極大アップ\nさせ、２種の物防ダウンスキルで序盤を一気に加勢する。", 0, 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (125301, 125301, 6, 0, 1, 0, 0, "2025/04/30 11:59:59", "コッコロ（レンジャー）", 0, 3, "こっころ", 0, 125301, 2.07, "2025/04/26 12:00:00", 752, 450, 0, 6, 125301, 0, "【物理】後衛で、わんわんと一緒の新緑レンジャー少女。\n自分の攻撃力に応じて強化される物理攻撃支援スキルや\nＨＰ継続回復、バリアで周囲を支え、絆の勝利へと導く。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (125401, 125401, 8, 0, 1, 0, 0, "2030/12/31 15:00:00", "シオリ（レンジャー）", 0, 3, "しおり", 0, 125401, 2.09, "2023/04/10 12:00:00", 710, 450, 0, 8, 125401, 0, "【物理】後衛で、相棒と共に山を駆ける新米レンジャー。\nスキルで自分の攻撃力とクリティカル時のダメージを上げ\nＴＰを回復し、ダメージと防御力ダウンで敵を追い込む。", 0, 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (125501, 125501, 50, 0, 2, 0, 0, "2025/05/31 11:59:59", "ジータ（ウォーロック）", 0, 3, "じーた", 0, 125501, 1.92, "2025/05/15 15:00:00", 443, 450, 0, 7, 125501, 0, "【魔法】中衛で、他の術者と魔力を束ねる究竟の魔導士。\n味方への魔法攻撃支援とＴＰ回復に加え、敵陣の攻防両面\nの弱体化で戦況を整え、自らも強力な攻撃魔法を放つ。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (125601, 125601, 0, 0, 1, 0, 0, "2025/05/31 11:59:59", "ビカラ", 0, 3, "びから", 0, 125601, 2.09, "2025/05/15 15:00:00", 267, 450, 0, 51, 125601, 0, "【物理】前衛で夢と希望とネズ耳を届ける鼠神宮の巫女。\n周囲の味方の物理攻撃支援、ＴＰ上昇アップと回復で援護\nし、自身の無敵化で敵の隙を突き鋭い金牙の一撃を放つ。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (125701, 125701, 9, 0, 2, 0, 0, "2030/12/31 15:00:00", "カリン（アルケミスト）", 0, 1, "かりん", 0, 125701, 2.24, "2025/04/16 15:00:00", 579, 450, 0, 7, 125701, 0, "【魔法】中衛で森羅万象を究め味方を支援する錬金術師。\n物理、魔法の属性を問わない敵の弱体化と味方の強化に加\nえ、スキルによる高頻度のＨＰ回復で盤石な戦局を築く。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (125801, 125801, 0, 0, 1, 0, 0, "2030/12/31 15:00:00", "リリ（フォールン）", 0, 3, "りり", 0, 125801, 2.09, "2023/04/17 12:00:00", 464, 450, 0, 3, 125801, 0, "【物理】中衛で、黒羽の力を使い空を制する嘆鎌の少女。\nバトル開始時に、敵の範囲攻撃を躱す【飛行】状態となり\n生成したシャドウと共に、眼前の敵を一薙ぎに斬り払う。", 0, 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 125901, 1, 0, 0, 0, 0, "2030/12/31 15:00:00", "カヤ（リベレイター）", 0, 3, "かや", 0, 0, 0.0, "2015/04/01 15:00:00", 0, 0, 0, 1, 125901, 0, "", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (126001, 126001, 0, 0, 1, 0, 0, "2030/12/31 15:00:00", "クリア（フォールン）", 0, 3, "くりあ", 0, 126001, 2.09, "2023/10/31 12:00:00", 406, 450, 0, 0, 126001, 0, "【物理】中衛から、我が身を盾に味方を守る隠棘の少女。\nバトル開始時【飛行】し、最もＨＰの低い味方をかばい、\n味方のＨＰに応じて強化されるスキルで敵を牽制する。", 0, 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (126101, 126101, 53, 0, 2, 0, 0, "2030/12/31 15:00:00", "プレシア（フォールン）", 0, 3, "ぷれしあ", 0, 126101, 2.09, "2023/11/15 15:00:00", 480, 450, 0, 44, 126101, 0, "【魔法】中衛で、マイペースに味方を支える破杖の少女。\n【飛行】し、クリティカルの強化やＨＰ・ＴＰ回復で味方\nを支援し、魔法攻撃力を加えた物理攻撃で敵を平らげる。", 0, 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (126201, 126201, 3, 0, 2, 0, 0, "2025/06/20 11:59:59", "イリヤ（儀装束）", 0, 3, "いりや", 0, 126201, 2.09, "2025/06/10 12:00:00", 568, 450, 0, 3, 126201, 0, "【魔法】中衛で、眷属と永久の血盟を誓う月下の吸血鬼。\nＵＢで眷属を２体喚び、味方への攻撃支援や行動速度上昇\nで強化し、眷属と共に見舞う猛攻で前途を阻む敵を討つ。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (126301, 126301, 9, 0, 2, 0, 0, "2030/12/31 15:00:00", "ユキ（儀装束）", 0, 3, "ゆき", 0, 126301, 2.07, "2023/06/15 15:00:00", 456, 450, 0, 7, 126301, 0, "【魔法】中衛で、闇色の儀装束を纏う「美を統べる者」。\nステータスアップ効果を受け【美貌】を増し、魔法攻撃力\nダウンや味方の強化、ＴＰ回復の効果を高めて解き放つ。", 0, 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (126401, 126401, 1, 0, 1, 0, 0, "2025/09/16 14:59:59", "クローチェ", 0, 3, "くろーちぇ", 0, 126401, 2.09, "2025/08/31 12:00:00", 373, 450, 0, 1, 126401, 0, "【物理】中衛で着脱可能な鉄腕を放つ機械人族のロボ娘。\nＵＢ発動で【フルチャージ】状態になり、【バッテリー】\nが切れるまで強化スキルを連発し、一帯を超速圧砕する。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (126501, 126501, 0, 0, 2, 0, 0, "2025/09/16 14:59:59", "ライラエル", 0, 3, "らいらえる", 0, 126501, 1.965, "2025/08/31 12:00:00", 740, 450, 0, 7, 126501, 0, "【魔法】後衛で優美にほほ笑むジオ・テオゴニアの姫君。\n開始時に発動する【界雷】で、敵味方に影響を与えつつ、\n魔法防御ダウンと強力なダメージスキルで裁きを下す。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (126601, 126601, 7, 0, 2, 0, 0, "2025/08/15 14:59:59", "ネネカ（サマー）", 0, 3, "ねねか", 0, 126601, 2.04, "2025/08/10 12:00:00", 650, 450, 0, 7, 126601, 0, "【魔法】後衛で、涼しげに微笑む夏色姿の『変貌大妃』。\nスキルで味方を大幅に強化し、最も魔法攻撃力が高い味方\nの魔法攻撃力を写し取った攻撃力で、強力なＵＢを放つ。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (126701, 126701, 5, 0, 1, 0, 0, "2030/12/31 15:00:00", "アキノ（サマー）", 0, 1, "あきの", 0, 126701, 1.965, "2025/06/17 15:00:00", 224, 450, 0, 5, 126701, 0, "【物理】前衛で、優雅なバカンスを過ごす夕映えの令嬢。\n敵が魔法攻撃をする場合に効果を大幅に上げる２種の範囲\n攻撃と攻防両面の支援スキルで、盛夏の勝鬨を上げる。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (126801, 126801, 5, 0, 1, 0, 0, "2030/12/31 15:00:00", "ユカリ（サマー）", 0, 3, "ゆかり", 0, 126801, 1.97, "2023/07/15 15:00:00", 159, 450, 0, 5, 126801, 0, "【物理】前衛で、夏の麦しゅわを嗜むビーチの元聖騎士。\n敵単体にダメージを与えながら、周囲の味方への魔法無効\nバリア付与と魔防アップで守りを固めて勝利の波に乗る。", 0, 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (126901, 126901, 21, 0, 2, 0, 0, "2025/08/31 11:59:59", "ランファ（サマー）", 0, 3, "らんふぁ", 0, 126901, 1.965, "2025/08/22 12:00:00", 682, 450, 0, 7, 126901, 0, "【魔法】後衛で、密やかな潮騒に耳を傾ける晩陽の歌姫。\n魔法クリティカルの極大アップを筆頭に攻防両面で周囲の\n味方を強化し、さらに自身もＵＢで数多の敵を退かせる。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (127001, 127001, 52, 0, 1, 0, 0, "2030/12/31 15:00:00", "クウカ（サマー）", 0, 1, "くうか", 0, 127001, 1.97, "2025/07/16 15:00:00", 133, 450, 0, 2, 127001, 0, "【物理】前衛で新たな刺激を追い求める水着姿のドＭ娘。\n自分のＨＰが下がるほど効果量が上昇するスキルの物理攻\n撃力アップとＵＢのダメージで、勝利の大海へ飛び込む。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (127101, 127101, 46, 0, 1, 0, 0, "2025/08/31 11:59:59", "シノブ（サマー）", 0, 3, "しのぶ", 0, 127101, 2.09, "2025/08/22 12:00:00", 255, 450, 0, 5, 127101, 0, "【物理】前衛で、穏やかな水面に揺蕩う夜光の霊能少女。\n召喚した親父に敵の攻撃を引き付けさせつつ、シノブ自身\nの攻撃性能強化と防御ダウンを扱い、敵を冥海へと誘う。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (127201, 127201, 7, 0, 2, 0, 0, "2025/09/30 11:59:59", "キャル（編入生）", 0, 3, "きゃる", 0, 127201, 2.09, "2025/09/16 15:00:00", 804, 450, 0, 7, 127201, 0, "【魔法】後衛で、制服姿に胸を高鳴らせるアオハル猫娘。\n攻防両面のサポートに加え行動速度アップとＴＰ回復で味\n方を支援し、最も遠くの敵を狙うＵＢで輝く勝利を得る。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (127301, 127301, 8, 0, 1, 0, 0, "2030/12/31 15:00:00", "スズナ（編入生）", 0, 3, "すずな", 0, 127301, 2.09, "2023/09/15 15:00:00", 750, 450, 0, 8, 127301, 0, "【物理】後衛でもにカワ制服を着こなすカリスマモデル。\nクリティカル時に味方を強化するスキルや、追加ダメージ\nが発生するＵＢによって青春の一ページを切り取る。", 0, 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 127401, 1, 0, 0, 0, 0, "2030/12/31 15:00:00", "ビカラ（コラボ）", 0, 3, "びから", 0, 0, 0.0, "2015/04/01 15:00:00", 0, 0, 0, 1, 127401, 0, "", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (127501, 127501, 4, 0, 1, 0, 0, "2024/11/18 11:59:59", "サレン（サラサリア）", 0, 3, "されん", 0, 127501, 2.09, "2024/11/11 12:00:00", 304, 450, 0, 4, 127501, 0, "【物理】中衛で、優艶に炎と踊り舞う情熱のサレンママ。\n物理攻撃から味方を守り、【炎舞の刻印】の数に応じて効\n果の上がる物攻アップとＴＰ回復で皆を奮い立たせる。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (127601, 127601, 4, 0, 1, 0, 0, "2030/12/31 15:00:00", "ルカ（サラサリア）", 0, 3, "るか", 0, 127601, 1.965, "2023/10/15 15:00:00", 157, 450, 0, 4, 127601, 0, "【物理】前衛で、空飛ぶ絨毯で巡り回るオアシスの姉御。\n自分の物防を大幅に高めて敵を挑発するスキルと敵のＴＰ\nとＴＰ上昇をダウンさせるＵＢで、爽やかに勝利を掴む。", 0, 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (127701, 127701, 48, 0, 2, 0, 0, "2030/12/31 15:00:00", "リンド", 0, 3, "りんど", 0, 127701, 1.965, "2024/10/10 12:00:00", 693, 450, 0, 6, 127701, 0, "【魔法】後衛で、メイド業に奔走する双子ドラゴンの姉。\nＵＢのフィールド展開中は攻撃、防御、ＴＰ回復と多彩な\n支援スキルの効果が再発動し味方を手厚くサポートする。", 0, 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (127801, 127801, 47, 0, 2, 0, 0, "2030/12/31 15:00:00", "ヴルム", 0, 3, "うるむ", 0, 127801, 1.965, "2024/10/18 12:00:00", 706, 450, 0, 7, 127801, 0, "【魔法】後衛で、文句を言いつつ働く双子ドラゴンの妹。\nダメージと魔法防御力ダウンを両立するスキルを持つが、\n目を離すと【サボりの誘惑】に負け、手を抜いてしまう。", 0, 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (127901, 127901, 5, 0, 2, 0, 0, "2024/12/15 14:59:59", "ペコリーヌ（クリスマス）", 0, 3, "ぺこりーぬ", 0, 127901, 1.965, "2024/12/09 12:00:00", 372, 450, 0, 5, 127901, 0, "【魔法】中衛でみんなに笑顔を届ける腹ペコサンタ王女。\n前線で敵の攻撃を耐えながら範囲内の味方の防御サポート\nと敵の防御ダウンまでこなし、聖夜に勝利の輝きを灯す。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (128001, 128001, 35, 0, 1, 0, 0, "2030/12/31 15:00:00", "クレジッタ（クリスマス）", 0, 3, "くれじった", 0, 128001, 2.09, "2023/12/15 15:00:00", 723, 450, 0, 35, 128001, 0, "【物理】後衛で、甘美なひと時を堪能する聖夜の女商人。\n最も遠い味方へのＴＰ回復や、初弾に追加効果のある攻撃\nで敵の弱体化と味方の強化を行い、勝利の舞台を整える。", 0, 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 128101, 0, 0, 0, 0, 0, "2030/12/31 15:00:00", "シズル（シズル&リノ）", 0, 3, "しずる", 181101, 0, 0.0, "2015/04/01 15:00:00", 580, 0, 0, 0, 128101, 0, "", 1, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 128201, 0, 0, 0, 0, 0, "2030/12/31 15:00:00", "リノ（シズル&リノ）", 0, 3, "りの", 181101, 0, 0.0, "2015/04/01 15:00:00", 580, 0, 0, 0, 128201, 0, "", 1, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (128301, 128301, 38, 0, 1, 0, 0, "2030/12/31 15:00:00", "イノリ（ニューイヤー）", 0, 1, "いのり", 0, 128301, 2.09, "2023/12/31 12:00:00", 191, 450, 0, 3, 128301, 0, "【物理】前衛で相手をからかうお調子者の年神ドラゴン。\n敵全体を挑発し、敵の妨害スキルにカウンターして前方の\n敵すべてをスタンさせるスキルで戦局を引っ掻き回す。", 1, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (128401, 128401, 21, 0, 2, 0, 0, "2025/01/15 14:59:59", "ハツネ（ニューイヤー）", 0, 3, "はつね", 0, 128401, 2.09, "2025/01/09 12:00:00", 801, 450, 0, 7, 128401, 0, "【魔法】後衛で特別な景色を共にする初夢超能力ガール。\n敵が物理攻撃を行う場合、攻撃性能の強化に加えて複数の\n弱体効果が追加され、攻守ともに味方を支援し敵を掃う。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (128501, 128501, 21, 0, 2, 0, 0, "2025/01/15 14:59:59", "カスミ（ニューイヤー）", 0, 3, "かすみ", 0, 128501, 2.09, "2025/01/09 12:00:00", 739, 450, 0, 7, 128501, 0, "【魔法】後衛で、絵馬に秘めた願いを祷る新年の名探偵。\n敵と味方の数で効果量が上昇するダメージと攻撃力支援に\n加え、２種類の回復スキルを使いこなして勝利を願う。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 128601, 1, 0, 0, 0, 0, "2030/12/31 15:00:00", "リリ（フォールン）", 0, 3, "りり", 0, 0, 0.0, "2015/04/01 15:00:00", 0, 0, 0, 1, 128601, 0, "", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (128701, 128701, 0, 0, 1, 0, 0, "2025/02/15 14:59:59", "ヒヨリ（アストラル）", 0, 3, "ひより", 0, 128701, 2.09, "2025/02/10 12:00:00", 226, 450, 0, 1, 128701, 0, "【物理】前衛で、煌炎宿し希望を振りまく覚醒の元気娘。\n放つ炎は敵を攻守ともに弱化させて同時に味方を鼓舞し、\n２種のＴＰ回復効果で攻勢を絶やさず勝利を呼び込む。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (128801, 128801, 0, 0, 1, 0, 0, "2030/12/31 15:00:00", "レイ（アストラル）", 0, 1, "れい", 0, 128801, 1.965, "2025/08/16 15:00:00", 194, 450, 0, 4, 128801, 0, "【物理】前衛で、旋風を纏い未来へ駆ける覚醒の剣士。\n目にも止まらぬ速さの剣技で敵を吹き飛ばしスタンさせ、\n仲間の守りを固めるスキルを駆使し勝利の道を切り開く。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (128901, 128901, 0, 0, 2, 0, 0, "2025/02/15 14:59:59", "ユイ（アストラル）", 0, 3, "ゆい", 0, 128901, 2.09, "2025/02/10 12:00:00", 772, 450, 0, 7, 128901, 0, "【魔法】後衛で、願いを力に極光を放つ覚醒の魔法士。\n自分を強化しながら高火力魔法を絶えず撃ち込み、バリア\nを起点とした味方への攻撃支援スキルで勝利を手にする。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (129001, 129001, 0, 0, 2, 0, 0, "2025/09/16 14:59:59", "エリス", 0, 3, "えりす", 0, 129001, 2.09, "2025/08/31 12:00:00", 800, 450, 0, 7, 129001, 0, "【魔法】後衛で、眠りから目覚め美しく咲き誇る黒薔薇。\n終焉を超えし【回帰の薔薇】と、行動速度アップを始めと\nした多種の攻防支援で味方を強化し、新たな未来を掴む。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (129301, 129301, 7, 0, 1, 0, 0, "2025/03/15 14:59:59", "ユニ（ウィンター）", 0, 3, "ゆに", 0, 129301, 2.09, "2025/03/10 12:00:00", 708, 450, 0, 7, 129301, 0, "【物理】後衛で、退廃的な冬の学びに溺れる水際の才媛。\n物理攻撃の強化、回復、行動速度アップで味方を支援し、\nＵＢで得た【水際の安寧】を死守するため膂力を振るう。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (129401, 129401, 2, 0, 1, 0, 0, "2030/12/31 15:00:00", "クロエ（ウィンター）", 0, 3, "くろえ", 0, 129401, 2.09, "2024/03/18 12:00:00", 188, 450, 0, 2, 129401, 0, "【物理】前衛で、水面に映る神速のダウナー系水着女子。\n攻撃を当てる度に敵に付与する【水月】の数に応じて物防\nダウンやダメージの効果が上昇し、必勝の抜き手を切る。", 0, 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (129501, 129501, 1, 0, 1, 0, 0, "2025/06/27 11:59:59", "チエル（ウィンター）", 0, 3, "ちえる", 0, 129501, 2.09, "2025/06/20 12:00:00", 247, 450, 0, 1, 129501, 0, "【物理】前衛で、ちぇるっとちぇるるな水着のちえるん。\nステータスアップで溜まる【ちぇる】を、自身の火力や\n支援能力に還元して、真冬の真夏をちぇらるれれぽぱぴ？", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (129601, 129601, 0, 0, 1, 0, 0, "2025/09/16 14:59:59", "アネモネ", 0, 3, "あねもね", 0, 129601, 2.09, "2025/08/31 12:00:00", 550, 450, 0, 0, 129601, 0, "【物理】中衛で怜悧麗花の陣を張るアルラウネの妖魔人。\n敵の攻撃力、防御力、与ダメージを下げ、ＴＰを吸収し、\nＵＢの継続ダメージで領域を侵す敵を絶えず拒み退ける。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (129701, 129701, 0, 0, 1, 0, 0, "2025/09/16 14:59:59", "ネフィ＝ネラ", 0, 3, "ねふぃーねら", 0, 129701, 2.09, "2025/08/31 12:00:00", 540, 450, 0, 0, 129701, 0, "【物理】中衛で万魔の頂点に君臨するジオ・ゲヘナの媛。\n環境効果【妨魔塵】で魔法攻撃を阻害し、行動速度アップ\n等の支援や苛烈な攻撃で無謀な不届き者を平伏させる。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (129801, 129801, 5, 0, 1, 0, 0, "2025/04/30 11:59:59", "マコト（コマンダー）", 0, 3, "まこと", 0, 129801, 2.09, "2025/04/26 12:00:00", 269, 450, 0, 5, 129801, 0, "【物理】前衛で、情と熱意で仲間を束ねる指揮官の狼娘。\n敵の攻守を削りつつ、自分のＴＰ回復や対象が物防ダウン\n状態の時に発生する追撃で猛攻を仕掛け前線を突破する。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (129901, 129901, 48, 0, 1, 0, 0, "2030/12/31 15:00:00", "エリコ（コマンダー）", 0, 3, "えりこ", 0, 129901, 1.84, "2024/04/15 15:00:00", 294, 450, 0, 6, 129901, 0, "【物理】前衛で、苛烈な教えで味方を率いる狂恋の教官。\nＴＰ回復や防御支援に加え味方の人数で効果アップする攻\n撃支援と大ダメージで、味方全体を奮い立たせ敵を破る。", 0, 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (130001, 130001, 0, 0, 1, 0, 0, "2025/05/15 14:59:59", "ヤマト", 0, 3, "やまと", 0, 130001, 2.09, "2025/05/03 19:00:00", 150, 450, 0, 4, 130001, 0, "【物理】前衛で、豪胆にスリルを嗜む盗賊ギルドの長女。\n最前線で命を張りながら、獲得した【バンディダイス】の\n消費によって自らを大幅強化し、有象無象を地に伏せる。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (130101, 130101, 9, 0, 1, 0, 0, "2025/05/15 14:59:59", "ワカナ", 0, 3, "わかな", 0, 130101, 2.09, "2025/05/03 19:00:00", 535, 450, 0, 7, 130101, 0, "【物理】中衛の、貧乏クジを引きがちな盗賊ギルド次女。\n召喚したスキッドがワカナをかばって前線に立ち、自身は\n攻撃支援にＨＰとＴＰ回復まで、献身的に味方を支える。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (130201, 130201, 0, 0, 1, 0, 0, "2025/05/15 14:59:59", "フブキ", 0, 3, "ふぶき", 0, 130201, 1.84, "2025/05/03 19:00:00", 371, 450, 0, 5, 130201, 0, "【物理】中衛の、ナマイキで超天才な盗賊ギルドの三女。\n【味方バリアー♡】で自分へのダメージを味方に押し付け\nＨＰ最大でダメージアップする範囲攻撃で敵を蹂躙する。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 130601, 1, 0, 0, 0, 0, "2030/12/31 15:00:00", "レイ（アストラル）", 0, 3, "れい", 0, 0, 0.0, "2015/04/01 15:00:00", 0, 0, 0, 4, 130601, 0, "", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (130701, 130701, 7, 0, 2, 0, 0, "2025/05/15 14:59:59", "キョウカ（スプリング）", 0, 3, "きょうか", 0, 130701, 1.92, "2025/05/03 19:00:00", 563, 450, 0, 7, 130701, 0, "【魔法】中衛で、お花畑に春を届ける花衣装の優等生。\nスキル発動回数に応じた効率的な自己強化やクリティカル\n時の追加効果を持つスキルとＵＢで勝利の風を吹かせる。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (130801, 130801, 7, 0, 2, 0, 0, "2030/12/31 15:00:00", "スズメ（スプリング）", 0, 3, "すずめ", 0, 130801, 1.84, "2024/05/15 15:00:00", 558, 450, 0, 7, 130801, 0, "【魔法】中衛で、春に彩られた花衣装のドジっ娘メイド。\n範囲内の敵にダメージを与えながら、多数の弱体化効果を\n持つスキルやＵＢを駆使して、穏やかに吹く勝利を掴む。", 0, 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (130901, 130901, 7, 0, 2, 0, 0, "2030/12/31 15:00:00", "クルル", 0, 3, "くるる", 0, 130901, 2.09, "2024/06/15 15:00:00", 440, 450, 0, 7, 130901, 0, "【魔法】中衛で、皆を夢の世界に誘う宝石兎族の支配人。\nステータスアップ効果を受けるたびに【かばばん君】を増\nやし、反射的に味方へ攻撃支援の恩返しをしてしまう。", 0, 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (131001, 131001, 7, 0, 2, 0, 0, "2025/06/20 11:59:59", "マホ（ドリームパーク）", 0, 3, "まほ", 0, 131001, 1.84, "2025/06/10 12:00:00", 702, 450, 0, 7, 131001, 0, "【魔法】後衛で、サーカスの舞台に輝くメルヘン少女。\n味方の攻防支援や敵の攻防弱体化の他【カーテンコール】\n付与時の追加ダメージスキルで、勝利のライトを照らす。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (131101, 131101, 52, 0, 1, 0, 0, "2030/12/31 15:00:00", "ネア（サマー）", 0, 3, "ねあ", 0, 131101, 2.09, "2024/06/30 12:00:00", 165, 450, 0, 2, 131101, 0, "【物理】前衛でハグの機会を窺う水着のスライムギャル。\n攻撃してきた敵に【ネバネバ】を自動で付着させ、攻撃力\nダウンやダメージ、束縛など複数の効果を引き起こす。", 0, 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (131201, 131201, 54, 0, 2, 0, 0, "2025/07/23 11:59:59", "ミソラ（サマー）", 0, 3, "みそら", 0, 131201, 2.09, "2025/07/10 12:00:00", 753, 450, 0, 54, 131201, 0, "【魔法】後衛で夏の盛りにイイコトをする溌溂水着少女★\n【PSI★ストーム】をチャージし、連続攻撃で敵を殲滅し\nて、継続ＴＰ回復やバリアで抜け目なく味方を支援する。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 131301, 1, 0, 0, 0, 0, "2030/12/31 15:00:00", "リリ", 0, 3, "りり", 0, 0, 0.0, "2015/04/01 15:00:00", 0, 0, 0, 1, 131301, 0, "", 1, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 131401, 1, 0, 0, 0, 0, "2030/12/31 15:00:00", "クリア", 0, 3, "くりあ", 0, 0, 0.0, "2015/04/01 15:00:00", 0, 0, 0, 1, 131401, 0, "", 1, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 131501, 1, 0, 0, 0, 0, "2030/12/31 15:00:00", "プレシア", 0, 3, "ぷれしあ", 0, 0, 0.0, "2015/04/01 15:00:00", 0, 0, 0, 1, 131501, 0, "", 1, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (131601, 131601, 4, 0, 1, 0, 0, "2025/07/23 11:59:59", "リリ（サマー）", 0, 3, "りり", 0, 131601, 1.92, "2025/07/10 12:00:00", 399, 450, 0, 4, 131601, 0, "【物理】中衛で、夏の陽光のもと研鑽する妹系大和撫子。\n防御力アップに加えバリアやＨＰ回復で味方の守りを固め\nＴＰ回復や攻撃力ダウンをも巧みに操り、場を支配する。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (131701, 131701, 53, 0, 2, 0, 0, "2025/08/15 14:59:59", "アメス（サマー）", 0, 3, "あめす", 0, 131701, 1.92, "2025/08/10 12:00:00", 743, 450, 0, 44, 131701, 0, "【魔法】後衛で、黄昏の水面に舞い降りる水着姿の妖精。\n行動速度アップやＴＰ支援をはじめとした多数のサポート\nを施しつつ、ＵＢの攻防弱体化で清爽に勝利へと導く。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (131801, 131801, 21, 0, 2, 0, 0, "2030/12/31 15:00:00", "ホマレ（サマー）", 0, 3, "ほまれ", 0, 131801, 2.09, "2024/08/15 15:00:00", 709, 450, 0, 7, 131801, 0, "【魔法】後衛で夏の清涼に翼を休める水着姿の龍の首領。\n攻防弱体化に加え、ステータスダウン付与のたび増加する\n【日食】の数に応じたダメージで、抗う全てを灰に帰す。", 0, 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (131901, 131901, 23, 0, 2, 0, 0, "2030/12/31 15:00:00", "エミリア（サマー）", 0, 1, "えみりあ", 0, 131901, 2.09, "2024/08/31 12:00:00", 725, 450, 1, 7, 131901, 0, "【魔法】後衛で、パックと共に戦う真夏のハーフエルフ。\n氷壁を生成するスキルや、強力なダメージと速度ダウンを\n付与するユニオンバーストで、敵の侵攻を食い止める。", 1, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (132001, 132001, 21, 0, 2, 0, 0, "2024/09/25 11:59:59", "エキドナ（サマー）", 0, 3, "えきどな", 0, 132001, 2.09, "2024/09/13 12:00:00", 775, 450, 1, 7, 132001, 0, "【魔法】後衛で未知の世界との邂逅に胸躍る強欲の魔女。\n鮮烈な攻撃魔法をはじめ、味方への攻撃支援、敵の弱体化\nから自己蘇生まで、あらゆる魔法を振るい、欲を満たす。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (132101, 132101, 24, 0, 1, 0, 0, "2024/09/13 11:59:59", "レム（サマー）", 0, 3, "れむ", 0, 132101, 2.09, "2024/08/31 12:00:00", 146, 450, 1, 13, 132101, 0, "【物理】前衛で夏の日差しの中、余暇を楽しむ双子の妹。\nＵＢで鬼族の力を解放すると攻防両面に加えＨＰ吸収が\n上昇し、目に映る全てを【狂騒】のままに叩き伏せる。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (132201, 132201, 7, 0, 2, 0, 0, "2025/05/15 14:59:59", "ノゾミ（アルケミスト）", 0, 3, "のぞみ", 0, 132201, 1.84, "2025/05/03 19:00:00", 721, 450, 0, 7, 132201, 0, "【魔法】後衛で、希望を錬成するアルケミストアイドル。\n【錬金素材】から【パフューム】を創り、ダメージに加え\nＴＰ回復や攻撃支援能力を向上させて勝利の香りを運ぶ。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (132301, 132301, 7, 0, 2, 0, 0, "2025/05/15 14:59:59", "ルイズマリー", 0, 3, "るいずまりー", 0, 132301, 2.09, "2025/05/03 19:00:00", 754, 450, 0, 7, 132301, 0, "【魔法】後衛で、底知れぬ叡智を秘めた天才錬金術師。\n高い方の防御力でダメージを受ける調和状態を付与し、\n２回まで性能が上昇していくＵＢで、妄想を爆発させる。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (132401, 132401, 0, 0, 1, 0, 0, "2030/12/31 15:00:00", "イロハ", 0, 3, "いろは", 0, 132401, 2.09, "2025/06/20 12:00:00", 501, 450, 0, 5, 132401, 0, "【物理】中衛で、大きな体で無邪気に遊び回る天才剣士。\n戦いの中で【剣圧】を溜め、その後のスキルやＵＢで物防\n一定無視のダメージを連発し、才気煥発の活躍を見せる。", 0, 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (132501, 132501, 23, 0, 2, 0, 0, "2030/12/31 15:00:00", "ソノ", 0, 3, "その", 0, 132501, 2.09, "2025/05/15 15:00:00", 636, 450, 0, 7, 132501, 0, "【魔法】後衛で、小柄で大人対応な錬金堂の省エネ店主。\n強力な弱体効果を与えながら、デバフ付与のたび増加する\n【虚脱】が80溜まると本気を出し定時厳守で戦い抜く。", 0, 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (132801, 132801, 0, 0, 2, 0, 0, "2025/06/20 11:59:59", "ライラエル（クリスマス）", 0, 3, "らいらえる", 0, 132801, 2.09, "2025/06/10 12:00:00", 750, 450, 0, 7, 132801, 0, "【魔法】後衛で、雪白の肌を黒衣に包んだ甘美なる姫君。\n味方のＨＰを代償に強力なバリアを展開しつつ、バリアを\n起点とした高出力の二連撃で、聖夜の大樹に灯を点す。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (132901, 132901, 46, 0, 2, 0, 0, "2030/12/31 15:00:00", "イオ（クリスマス）", 0, 3, "いお", 0, 132901, 2.09, "2024/12/09 12:00:00", 748, 450, 0, 5, 132901, 0, "【魔法】後衛で、心地良い眠りの中に訪れる聖夜の悪魔。\n最も魔法攻撃力が高い味方に【悪魔の口づけ】を付与し、\n攻撃支援とＴＰ回復による付きっきりの手ほどきをする。", 0, 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (133001, 133001, 0, 0, 1, 0, 0, "2025/09/16 14:59:59", "グレイス", 0, 3, "ぐれいす", 0, 133001, 2.09, "2025/08/31 12:00:00", 234, 450, 0, 0, 133001, 0, "【物理】前衛で、宙を舞うように戦う幽霊の守護騎士。\nＵＢで味方の攻撃と速度支援を行い、【レイスボディ】で\n敵の目を逃れ、不意を突く一撃で永遠の眠りにつかせる。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (133101, 133101, 0, 0, 1, 0, 0, "2025/09/16 14:59:59", "ヴァイオレット", 0, 3, "うぁいおれっと", 0, 133101, 1.75, "2025/08/31 12:00:00", 154, 450, 0, 0, 133101, 0, "【物理】前衛で、儚くも凛と咲くジオ・ニヴルヘルの姫。\n継続ダメージ効果を鈍化させる環境効果【忌火】で盾に、\n絶怠霊度の継続割合攻撃で矛となり、静寂の冥府を護る。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (133201, 133201, 22, 0, 1, 0, 0, "2030/12/31 15:00:00", "モニカ（ニューイヤー）", 0, 1, "もにか", 0, 133201, 2.09, "2024/12/31 12:00:00", 296, 450, 0, 4, 133201, 0, "【物理】前衛で、元日も元気にはしゃぎまわる軍人少女。\n与ダメージに応じて追加効果が強化されるＵＢと、発動ご\nとに成長する自己強化スキルで秩序を乱す者の目を回す。", 1, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (133501, 133501, 22, 0, 2, 0, 0, "2025/07/23 11:59:59", "サレン（ニューイヤー）", 0, 3, "されん", 0, 133501, 2.09, "2025/07/10 12:00:00", 718, 450, 0, 4, 133501, 0, "【魔法】後衛で、傍らで心を重ねる振袖姿の救護院の主。\n味方へのＴＰ回復の支援をしつつ、味方がＵＢを発動する\nたびダメージが上がるスキルで、共に困難を乗り越える。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (133601, 133601, 0, 0, 1, 0, 0, "2025/07/31 11:59:59", "メドゥーサ", 0, 3, "めどぅーさ", 0, 133601, 2.09, "2025/07/23 12:00:00", 445, 450, 0, 0, 133601, 0, "【物理】中衛で眷属と力を合わせて戦う誇り高き蛇乙女。\n【魔眼】の数に応じて効果量が上がるスキルのダメージと\n弱体化で範囲内の敵を追い詰め、鋭い瞳で石へと変える。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (133701, 133701, 0, 0, 2, 0, 0, "2025/08/22 11:59:59", "ラビリスタ（アルファ）", 0, 3, "らびりすた", 0, 133701, 2.09, "2025/08/15 15:00:00", 717, 450, 0, 8, 133701, 0, "【魔法】後衛で、始原の冠装を使いこなす『迷宮女王』。\n水属性の味方のＴＰ上昇を増加する領域を作り、連射攻撃\nで敵の防御を撃ち抜くことで七冠の力を敵に知らしめる。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (133801, 133801, 0, 0, 2, 0, 0, "2025/08/22 11:59:59", "ネネカ（アルファ）", 0, 3, "ねねか", 0, 133801, 2.09, "2025/08/15 15:00:00", 759, 450, 0, 7, 133801, 0, "【魔法】後衛から、始原の姿で戦況を操る『変貌大妃』。\n召喚したグレゴールから攻撃支援とＴＰ回復を受け、互い\nの魔力を合わせた連携攻撃で、幽玄なる玉座に君臨する。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (133901, 133901, 0, 0, 1, 0, 0, "2025/08/22 11:59:59", "クリスティーナ（アルファ）", 0, 3, "くりすてぃーな", 0, 133901, 2.09, "2025/08/15 15:00:00", 228, 450, 0, 6, 133901, 0, "【物理】前衛で、始原の冠装の力を振るう『誓約女君』。\n10行動目に攻撃力を大幅アップし、スキルに追撃を発生\nさせる【虚数】を得て隔絶した力で楯突く敵を抹消する。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (134001, 134001, 0, 0, 2, 0, 0, "2025/09/16 14:59:59", "フィオ", 0, 3, "ふぃお", 0, 134001, 2.09, "2025/08/31 12:00:00", 746, 450, 0, 0, 134001, 0, "【魔法】後衛で、アストルムの冒険へと導くガイド妖精。\nバフとバリアで味方を護りバリアを起点とする攻撃支援、\n風属性の味方への行動速度とＴＰの支援で仲間を支える。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 134101, 1, 0, 0, 0, 0, "2030/12/31 15:00:00", "フブキ", 0, 3, "ふぶき", 0, 0, 0.0, "2015/04/01 15:00:00", 0, 0, 0, 5, 134101, 0, "", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 134201, 1, 0, 0, 0, 0, "2030/12/31 15:00:00", "ライラエル（クリスマス）", 0, 3, "らいらえる", 0, 0, 0.0, "2015/04/01 15:00:00", 0, 0, 0, 7, 134201, 0, "", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (134301, 134301, 0, 0, 2, 0, 0, "2025/09/30 11:59:59", "ランファ（儀装束）", 0, 3, "らんふぁ", 0, 134301, 2.09, "2025/09/16 15:00:00", 778, 450, 0, 7, 134301, 0, "【魔法】後衛で儀装束を纏い精霊と心を通わせる唱喚士。\n敵の数に応じてダメージ量が変化する範囲攻撃や、魔法\n無効バリアなどの支援スキルで想いを詩に乗せ響かせる。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (134401, 134401, 21, 0, 2, 0, 0, "2030/12/31 15:00:00", "チカ（儀装束）", 0, 3, "ちか", 0, 134401, 2.09, "2025/03/15 15:00:00", 773, 450, 0, 7, 134401, 0, "【魔法】後衛で儀装束を纏い歌を紡ぎ伝えていく唱喚士。\n自分と最も近くの味方へ強力なバフとＴＰ回復を行うこと\nで攻撃を支援し、共に心を通わせ美しき旋律を奏でる。", 0, 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (134501, 134501, 0, 0, 2, 0, 0, "2025/04/15 14:59:59", "クローチェ（エアリアル）", 0, 3, "くろーちぇ", 0, 134501, 2.09, "2025/04/08 12:00:00", 719, 450, 0, 0, 134501, 0, "【魔法】後衛で超速飛行からの大火力を叩き込むロボ娘。\n上空から速度バフで味方全体を支援しつつ、自分のバリア\nを解除して力へと変え、世界の命運を背負い飛翔する！", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (134601, 134601, 35, 0, 1, 0, 0, "2025/04/08 11:59:59", "アオイ（パイロット）", 0, 3, "あおい", 0, 134601, 2.09, "2025/03/31 12:00:00", 526, 450, 0, 35, 134601, 0, "【物理】中衛で巨大ロボを駆り戦うぼっちのパイロット。\n敵の弱体化や、味方へバリアを展開するスキルを持ち、\n鋼鉄の乙女から放つ光線はいかに堅固な守りも打ち破る。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (134701, 134701, 7, 0, 1, 0, 0, "2025/04/26 11:59:59", "ホウオウ", 0, 3, "ほうおう", 0, 134701, 2.09, "2025/04/15 15:00:00", 490, 450, 0, 7, 134701, 0, "【物理】中衛で、華麗に舞い踊る五色絢爛な煉華の鳳凰。\n攻撃力バフやバリア展開などの攻防支援と、多彩で豊富な\nＨＰ・ＴＰ供給を両立し、浄化の力で皆に安寧を授ける。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (134801, 134801, 1, 0, 1, 0, 0, "2025/06/10 11:59:59", "ツムギ（ジオ・ゲヘナ）", 0, 3, "つむぎ", 0, 134801, 1.84, "2025/05/31 12:00:00", 485, 450, 0, 1, 134801, 0, "【物理】中衛から、新たな素材で紡ぐワイルドテーラー。\n最も物攻が高い他の味方へ重複速度アップやＴＰ・攻撃支\n援を仕立て、全体へのＨＰ回復と併せ攻守を両立させる。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (134901, 134901, 0, 0, 1, 0, 0, "2025/06/20 11:59:59", "カノン", 0, 3, "かのん", 0, 134901, 2.09, "2025/06/10 12:00:00", 196, 450, 0, 2, 134901, 0, "【物理】前衛で、おエレガントな高笑いを轟かすド令嬢。\nＵＢや敵からの攻撃で【お堪忍袋】が尽きると逆上し、強\n化されたスキルと行動パターンで華麗におリベンジする。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (135001, 135001, 21, 0, 2, 0, 0, "2025/07/10 11:59:59", "エリス（サマー）", 0, 3, "えりす", 0, 135001, 2.09, "2025/06/30 12:00:00", 785, 450, 0, 7, 135001, 0, "【魔法】後衛で、永く夢見た本物の夏に咲き綻ぶ黒薔薇。\n【いばらの冠】の呪縛は再臨により解き放たれ、調和状態\nや攻防支援、回復効果を施し、月下の浜辺に静かに佇む。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (135101, 135101, 4, 0, 1, 0, 0, "2025/07/23 11:59:59", "シェフィ（サマー）", 0, 3, "しぇふぃ", 0, 135101, 2.09, "2025/07/10 12:00:00", 143, 450, 0, 4, 135101, 0, "【物理】前衛で盛夏の白波を華麗に乗りこなす氷竜少女。\n敵全体を挑発し、被弾で溜まる【ぐずぐず】をＵＢで発散\nすることで周囲に攻撃支援と天真爛漫な笑顔を振りまく。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (135201, 135201, 7, 0, 2, 0, 0, "2025/07/31 11:59:59", "プレシア（サマー）", 0, 3, "ぷれしあ", 0, 135201, 2.09, "2025/07/23 12:00:00", 548, 450, 0, 7, 135201, 0, "【魔法】中衛で夏の食を満喫し、ぷかぷか漂う天然少女。\nＴＰ・攻撃支援やバリアは味方の数で効果量が変化し、物\n理と魔法攻撃力合算のダメージで夏の思い出を心に刻む。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (135301, 135301, 54, 0, 1, 0, 0, "2025/08/10 11:59:59", "クリア（サマー）", 0, 3, "くりあ", 0, 135301, 2.09, "2025/07/31 12:00:00", 413, 450, 0, 54, 135301, 0, "【物理】中衛で友情の芽を育む、真夏の『普通』の少女。\n【プルメリアのお守り】で強力な一撃から先頭を守り、味\n方の数で効果量が変化するスキルを鮮やかに命中させる。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (135401, 135401, 52, 0, 2, 0, 0, "2025/08/15 14:59:59", "アネモネ（サマー）", 0, 3, "あねもね", 0, 135401, 2.09, "2025/08/10 12:00:00", 553, 450, 0, 2, 135401, 0, "【魔法】中衛で砂浜の木陰に微睡むアルラウネの妖魔人。\n行動速度アップや初回使用時に回復量が増加するＴＰ回復\nを起点に支援し、穏やかな木漏れ日と共にゆらゆら憩う。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (135501, 135501, 0, 0, 1, 0, 0, "2025/09/08 11:59:59", "アイラ", 0, 3, "あいら", 0, 135501, 2.09, "2025/08/31 12:00:00", 213, 450, 0, 1, 135501, 0, "【物理】前衛で、世界を守り笑顔を咲かせる情熱の豪炎。\n前方の敵全てを対象とする連撃の強化通常攻撃や、天楼覇\n断剣から放たれる極大ダメージの一閃で未来を切り拓く。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (135601, 135601, 0, 0, 1, 0, 0, "2025/09/16 14:59:59", "シナツ", 0, 3, "しなつ", 0, 135601, 0.4, "2025/09/08 12:00:00", 198, 450, 0, 4, 135601, 0, "【物理】前衛から、風裂く刃で世界を護る孤高の剣豪。\n卓越した剣技で敵の攻撃を捌いて反撃し、初回ＵＢで生成\nする分身と共に疾風迅雷の攻めで、未来へと駆け抜ける。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (135701, 135701, 0, 0, 1, 0, 0, "2030/12/31 15:00:00", "ヒヨリ（サラサリア）", 0, 3, "ひより", 0, 135701, 1.84, "2025/09/16 15:00:00", 291, 450, 0, 1, 135701, 0, "【物理】前衛で、二人きりの月下の空旅にときめく黒猫。\n物防弱体の他、ダメージ100ヒット後には華麗なステップ\nの追撃とＴＰ回復量増加で、砂漠の夜空に花を咲かせる。", 0, 0);
