INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (137101, 137101, 47, 0, 2, 0, 0, "2030/12/31 15:00:00", "ニノン（サマー）", 0, 3, "にのん", 0, 137101, 2.09, "2025/08/15 15:00:00", 566, 450, 0, 8, 137101, 0, "【魔法】中衛で陽光の下、煌く水面を共に駆けるシノビ。\n【水遁の印】を自らの攻撃力へと変え、束縛フィールドと\n水遁の術で最も遠い敵とその周囲に速やかな天誅を下す。", 0, 0);
