INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (105701, 170101, 34, 0, 1, 4, 0, "2030/12/31 15:00:00", "ジータ", 0, 3, "じーた", 0, 170101, 1.965, "2015/04/01 15:00:00", 245, 450, 0, 34, 170101, 0, "【物理】前衛で、先手必勝の大技を繰り出す騎空士。\nスキルによるＴＰ回復は、ユニオンバーストの発動を早め\nバトルの序盤から敵前衛に大ダメージを与える。", 0, 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (180101, 180101, 0, 0, 1, 7, 0, "2025/09/16 14:59:59", "ヒヨリ（プリンセス）", 0, 3, "ひより", 0, 180101, 1.62, "2025/08/31 12:00:00", 199, 450, 0, 0, 180101, 0, "【物理】前衛で炎翼を背に敵を粉砕する、陽気な元気娘。\n戦いが続く程に自身の攻撃能力を強めるスキルを操り、\n高めた力で放つ超爆の一撃は、あらゆる敵を塵と化す。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (180201, 180201, 0, 0, 2, 1, 0, "2025/09/16 14:59:59", "ユイ（プリンセス）", 0, 3, "ゆい", 0, 180201, 1.92, "2025/08/31 12:00:00", 767, 450, 0, 0, 180201, 0, "【魔法】後衛から極大魔法で敵を滅する願いの魔法士。\nＴＰを回復しつつ攻撃力を累積アップする補助スキルで\n自身の力を高め、強力な範囲攻撃を放ち敵を一掃する。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (180301, 180301, 0, 0, 1, 7, 0, "2025/09/16 14:59:59", "レイ（プリンセス）", 0, 3, "れい", 0, 180301, 1.965, "2025/08/31 12:00:00", 377, 450, 0, 0, 180301, 0, "【物理】中衛で風刃を従え激戦を流麗に征く嵐翼の剣士。\n敵が多い程に効果が高まる自己強化スキルで、自身を奮い\n立たせ、強力な範囲攻撃スキルで一切の敵を鏖滅する。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (180401, 180401, 0, 0, 1, 1, 0, "2025/09/16 14:59:59", "ペコリーヌ（プリンセス）", 0, 3, "ぺこりーぬ", 0, 180401, 1.965, "2025/08/31 12:00:00", 155, 450, 0, 0, 180401, 0, "【物理】前衛で、攻防共に絶大な力を誇る腹ペコ王女。\nＨＰが多い時は爆発的な攻撃力で、いかなる敵をも屠り、\nＨＰが減ると自己回復能力を得て、鉄壁の護りを見せる。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (180501, 180501, 0, 0, 1, 1, 0, "2025/09/16 14:59:59", "コッコロ（プリンセス）", 0, 3, "こっころ", 0, 180501, 2.14, "2025/08/31 12:00:00", 555, 450, 0, 0, 180501, 0, "【物理】中衛で、絶大な補助スキルを繰出す純白の巫女。\n味方の攻撃力とクリティカルダメージを強化しつつ、\n二つの全体回復スキルで味方を堅固に守護し勝利へ導く。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (180601, 180601, 0, 0, 2, 1, 0, "2025/09/16 14:59:59", "キャル（プリンセス）", 0, 3, "きゃる", 0, 180601, 1.92, "2025/08/31 12:00:00", 747, 450, 0, 0, 180601, 0, "【魔法】後衛で、極大魔法を操り敵を討つ姫装の猫娘。\n回復や補助を兼ねた各攻撃スキルを駆使し戦況を整え、\n極大威力のユニオンバーストを撃ち込み敵を燼滅する。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (180701, 180701, 0, 0, 1, 1, 0, "2025/09/16 14:59:59", "ハツネ＆シオリ", 0, 3, "はつねしおり", 0, 180701, 1.75, "2025/08/31 12:00:00", 732, 450, 0, 0, 180701, 0, "【物理】後衛から、真の絆の力を発揮する仲良し姉妹。\n敵の数が増えるほど威力が高まる攻撃スキルと、周りの\n味方を強化するスキルを操り、立ち塞がる敵を一掃する。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (180801, 180801, 0, 0, 1, 1, 0, "2025/09/16 14:59:59", "ミソギ＆ミミ＆キョウカ", 0, 3, "みそぎみみきょうか", 0, 180801, 1.5, "2025/08/31 12:00:00", 465, 450, 0, 0, 180801, 0, "【物理】中衛で敵単体に必殺の一撃を放つ仲良しトリオ。\n３人の力を合わせて放つ攻撃は、相手の弱点に合わせて\n物理から魔法攻撃に変化し、どんな強い敵も退治する！", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (180901, 180901, 0, 0, 1, 1, 0, "2025/09/16 14:59:59", "アキノ＆サレン", 0, 3, "あきのされん", 0, 180901, 2.09, "2025/08/31 12:00:00", 421, 450, 0, 0, 180901, 0, "【物理】中衛で背を預けあう最高の好敵手で親友の二人。\n味方の物理攻撃をサポートしつつＨＰとＴＰを継続回復し\nＨＰが多いほど威力が増すＵＢで、共に勝利の道を征く。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (181001, 181001, 0, 0, 2, 1, 0, "2025/09/16 14:59:59", "アン＆グレア", 0, 3, "あんぐれあ", 0, 181001, 2.09, "2025/08/31 12:00:00", 577, 450, 0, 0, 181001, 0, "【魔法】中衛で、魔力共鳴し連撃を放つマナリアの双姫。\nステータスアップ効果を受けると増加する【友情の魔印】\nがスキルを強化し、波長を合わせた炎の魔槍で敵を討つ。", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (181101, 181101, 0, 0, 1, 1, 0, "2025/09/16 14:59:59", "シズル＆リノ", 0, 3, "しずるりの", 0, 181101, 1.92, "2025/08/31 12:00:00", 551, 450, 0, 0, 181101, 0, "【物理】中衛でお揃い衣装の、真偽を超えた仲良し姉妹。\n攻守共に味方を支えるシズルと、クリティカル時に強力な\nダメージを与えるリノ、姉妹の絆で困難を跳ね除ける！", 0, 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (181201, 181201, 0, 0, 1, 1, 0, "2025/09/16 14:59:59", "シェフィ（プリンセス）", 0, 3, "しぇふぃ", 0, 181201, 1.92, "2025/08/31 12:00:00", 368, 450, 0, 0, 181201, 0, "【物理】中衛で新たな力と共に再廻する姫装の氷竜少女。\n環境効果【絶氷】でクリティカルダメージを高め、火力と\n手数を併せ持つ剣技で、再び共に歩むため道を切り開く。", 0, 1);
