INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (191301, 191301, 6, 0, 1, 0, 0, "2030/12/31 15:00:00", "カズマサ", 0, 1, "かずまさ", 0, 191301, 2.22, "2015/04/01 15:00:00", 850, 450, 0, 6, 191301, 0, "【物理】皆から愛される漁師町のポンコツ漁師。\nユニオンバーストは強力なスタン効果を持つが、\n自身のＨＰが50%以下では尻もちをついてしまう。\n\n・通常攻撃とユニオンバーストを駆使して戦う。", 0, 1);
